const iS='http:';const sS='https:';const pr_redirect=(iTS=true)=>{if(iTS){location.protocol=sS;}else{location.protocol=iS;}};const pr_execute=()=>{if(typeof Swal!='undefined'){if(location.protocol==iS){Swal.fire({toast:true,position:'top-end',showConfirmButton:false,timer:7500,timerProgressBar:true,onOpen:toast=>{toast.addEventListener('mouseenter',Swal.stopTimer);toast.addEventListener('mouseleave',Swal.resumeTimer);},icon:'warning',title:`Estás navegando a través del protocolo ${iS}(inseguro). ¿Deseas ir a ${sS}(seguro)?`,html:'<button class="btn btn-ocean" onclick="pr_redirect()">Sip</button>'});}}};document.addEventListener('DOMContentLoaded',pr_execute);